pragma solidity ^0.4.24;

import "openzeppelin-eth/contracts/math/SafeMath.sol";
import "openzeppelin-eth/contracts/ownership/Ownable.sol";
import "./Core.sol";
import "./usingOraclize.sol";
import "zos-lib/contracts/Initializable.sol";

// TODO: Remove Auctions references from this contract.

/*
@dev Contract in charge of creating auctions for G1P horses
from 1 to 10, i.e. ZED 1 / ZED 10, having a lower genotype makes a horse rarer.
*/
contract GOPCreator is Initializable, Ownable, usingOraclize {
    using SafeMath for uint256;

    bool anyBatchOpen;

    uint256 currentOpenBatch;
    uint256[] gopsAuctionsList;
    uint256[] openAuctions;

    Core core;

    struct GOP {
        uint256 createdAt;
        uint256 maxBid;
        uint256 minimum;

        uint256 horse;

        address maxBidder;
        address horseOwner;
        address[] bidders;

        bool isOpen;

        string horseHash;

        mapping(address => uint256) bidFor;
        mapping(address => bool) exists;
    }

    mapping(uint256 => GOP) internal gopAuctions;
    mapping(uint256 => uint256) internal horsesForGen;
    mapping(uint256 => bool) internal firstHalfCompleted;
    mapping(address => uint256[]) internal auctionsParticipating;
    mapping(address => uint256[]) internal auctionsCreatedBy;
    mapping(uint256 => uint256) internal auctionIndex;

    event LogGOPBid(address _owner, uint256 _amount);
    event LogGOPClaim(address _claimer);

    function initialize(address _addr, address _owner) public initializer {
        Ownable.initialize(_owner);
        core = Core(_addr);
        // OAR = OraclizeAddrResolverI(0x6f485C8BF6fc43eA212E93BBF8ce046C7f1cb475);

        // From 1 to 4 there will be 500 more available for later use.
        horsesForGen[1] = 1000;
        horsesForGen[2] = 1000;
        horsesForGen[3] = 1000;
        horsesForGen[4] = 1000;
        horsesForGen[5] = 2000;
        horsesForGen[6] = 3000;
        horsesForGen[7] = 4000;
        horsesForGen[8] = 6000;
        horsesForGen[9] = 9000;
        horsesForGen[10] = 10000;
    }

    /*
    @dev Manually opens a batch of horses.
    */
    function openBatch(uint256 _batch) public onlyOwner() {
        // require(!anyBatchOpen, "A batch is already open");
        require(_batch >= 1 && _batch <= 10, "Gen not recognized");

        closeBatch();

        anyBatchOpen = true;
        currentOpenBatch = _batch;
    }

    /*
    @dev Closes a given batch, we only allow one batch open at a time.
    */
    function closeBatch() public onlyOwner() {
        anyBatchOpen = false;
        currentOpenBatch = 0;
    }

    /*
    @dev  Depending of the batch open we're going to directly sell the horse or
    put them in Auctions first, only owner can put the horse into Auctions.
    */
    function createGOP(address _owner, string _hash) public payable returns(uint256) {
        require(anyBatchOpen, "No batch open");
        require(horsesForGen[currentOpenBatch] != 0, "Cap for specified genotype already met");

        uint256 amount;

        // We could have used a mapping for this instead but it wasn't initialized.
        if(currentOpenBatch == 1) amount = 0.40 ether;
        if(currentOpenBatch == 2) amount = 0.30 ether;
        if(currentOpenBatch == 3) amount = 0.25 ether;
        if(currentOpenBatch == 4) amount = 0.20 ether;
        if(currentOpenBatch == 5) amount = 0.185 ether;
        if(currentOpenBatch == 6) amount = 0.18 ether;
        if(currentOpenBatch == 7) amount = 0.175 ether;
        if(currentOpenBatch == 8) amount = 0.17 ether;
        if(currentOpenBatch == 9) amount = 0.165 ether;
        if(currentOpenBatch == 10) amount = 0.16 ether;

        uint256 horseId = saleHorse(_owner, _hash, amount);
        return horseId;
    }

    function saleHorse(address _owner, string _hash, uint256 _amount) private returns(uint256) {
        require(msg.value >= _amount, "Price not met");

        uint256 horseId = core.mintToken(_owner, _hash, currentOpenBatch);

        if(horseId == 0) return horseId;

        horsesForGen[currentOpenBatch] = horsesForGen[currentOpenBatch].sub(1);

        /*
        Check if we should close the batch automatically.
        This happens only once when a batch has sold 500 horses.
        You can re-open the batch again and the horses will sell depending on the batch open.
        */
        if(_shouldClose()) {
            anyBatchOpen = false;
            currentOpenBatch = 0;
        }

        owner().transfer(msg.value);

        return horseId;
    }

    /*
    @dev Creates a custom horse from the specified params. Mostly for marketing purposes.
    @dev This horse also counts for the 38.000 horses that'll get released. '_batch' is the identifier.
    */
    function createCustomHorse(address _owner, string _hash, uint256 _batch, bytes32 _gender)
    public
    returns(uint256) {
        require(horsesForGen[_batch] != 0, "Limit for genotype reached");
        require(msg.sender == owner() || msg.sender == foundationAuctions, "unauthorized");

        uint256 tokenId = core.mintCustomHorse(_owner, _hash, _batch, _gender);

        horsesForGen[_batch] = horsesForGen[_batch].sub(1);

        return tokenId;
    }

    /*
    @dev Creates a random horse for the given batch.
    @dev 'Random' in this context means that we won't decide the gender or other data.
    */
    function createRandomHorseFor(address _owner, string _hash, uint256 _batch)
    public
    returns(uint256) {
        require(horsesForGen[_batch] != 0, "Limit for genotype reached");
        require(msg.sender == owner() || msg.sender == foundationAuctions, "unauthorized");
        uint256 tokenId = core.mintToken(_owner, _hash, _batch); // '_batch' is horse's genotype.

        horsesForGen[_batch] = horsesForGen[_batch].sub(1);

        return tokenId;
    }

    // We can use this function to create single auctions.
    function createFoundationAuction(string _hash) public payable onlyOwner() {
        require(currentOpenBatch >= 5 && currentOpenBatch <= 10, "Batch out of bounds");
        require(msg.value >= oraclize_getPrice("URL"), "Oraclize price not met");

        uint256 amount;

        if(currentOpenBatch == 5) amount = 0.40 ether;
        if(currentOpenBatch == 6) amount = 0.38 ether;
        if(currentOpenBatch == 7) amount = 0.35 ether;
        if(currentOpenBatch == 8) amount = 0.33 ether;
        if(currentOpenBatch == 9) amount = 0.28 ether;
        if(currentOpenBatch == 10) amount = 0.25 ether;

        _createAuction(amount, _hash, currentOpenBatch);

        horsesForGen[currentOpenBatch] = horsesForGen[currentOpenBatch].sub(1);
    }

    /*
    @dev The auction functionality here is the same as the logic in the 'SaleContract' used for
    auctions from users.
    */
    function _createAuction(uint256 _minimum, string _hash, uint256 _batch) private {
        uint256 id = gopsAuctionsList.push(1);

        // The owner of the horse will be the contract for as long as the Auction last.
        // uint256 horseId = core.mintToken(this, _hash, _batch);

        GOP memory g;
        g.horseOwner = msg.sender;
        g.createdAt = now;
        g.minimum = _minimum;
        g.isOpen = true;
        g.horse = _batch;
        g.horseHash = _hash;

        gopAuctions[id] = g;

        string memory url = "json(https://api.zed.run/api/v1/close_auction).auction_closed";
        string memory payload = strConcat("{\"auction\":", uint2str(id), "}");

        uint256 index = openAuctions.push(id) - 1;
        auctionIndex[id] = index;

        // Default is one week in seconds
        // TODO: Maybe change time: 604800
        oraclize_query(600, "URL", url, payload);

        auctionsCreatedBy[msg.sender].push(id);
    }

    function __callback(bytes32 _id, string _result) public {
        require(msg.sender == oraclize_cbAddress(), "Not oraclize");
        uint256 id = parseInt(_result);

        _removeAuction(id);

        gopAuctions[id].isOpen = false;
    }

    function foundationAuctionBid(uint256 _auctionId) public payable {
        GOP storage a = gopAuctions[_auctionId];

        require(a.isOpen, "Auction not open");

        uint256 userBid = a.bidFor[msg.sender].add(msg.value);

        require(userBid > a.maxBid, "Bid lower than maximum bid");

        if(a.bidders.length == 0) {
            require(msg.value >= a.minimum, "Bid lower than minimum");
        }

        a.bidFor[msg.sender] = userBid;

        if(!a.exists[msg.sender]) {
            a.bidders.push(msg.sender);
            a.exists[msg.sender] = true;

            auctionsParticipating[msg.sender].push(_auctionId);
        }

        a.maxBid = userBid;
        a.maxBidder = msg.sender;

        emit LogGOPBid(msg.sender, userBid);
    }

    /*
    @dev Claim the price (Minted token), ether if user didn't win and maximum bid if the user is the owner.
    */
    function foundationAuctionWithdraw(uint256 _auction) public returns(bool) {
        // 'owner' doesn't get anything from here.
        GOP storage g = gopAuctions[_auction];

        require(!g.isOpen, "Auction still open");

        // Transfer a token for 'maxBidder'.
        if(msg.sender == g.maxBidder) {
            // Mint the horse.
            core.mintToken(msg.sender, g.horseHash, g.horse);
            // core.safeTransferFrom(this, msg.sender, g.horse);
            delete g.maxBidder;
        }

        // Transfer 'maxBid' to the owner.
        if(msg.sender == owner()) {
            // If auction has 0 bidders then we will send the horse back to the owner.
            // if(g.bidders.length == 0) {
            //     core.safeTransferFrom(this, msg.sender, g.horse);

            //     return true;
            // }

            msg.sender.transfer(g.maxBid);
            delete g.maxBid;
        }

        // Sends money back to user if they didn't win.
        if(msg.sender != g.maxBidder && msg.sender != owner()) {
            msg.sender.transfer(g.bidFor[msg.sender]);
            delete g.bidFor[msg.sender];
        }

        emit LogGOPClaim(msg.sender);

        return true;
    }

    /*
    @dev returns the information from a GOP Auction
    */
    function auctionInformation(uint256 _auction)
    public
    view
    returns(uint256, uint256, uint256, uint256, uint256, address, bool) {
        GOP memory g = gopAuctions[_auction];
        return(g.createdAt, g.minimum, g.horse, g.bidders.length, g.maxBid, g.maxBidder, g.isOpen);
    }

    /*
    @dev Returns the ramining horses for a given gen.
    */
    function horsesRemaining(uint256 _gen) public view returns(uint256) {
        return horsesForGen[_gen];
    }

    /*
    @dev Returns bool indicating if a batch is open and which one is it
    mostly used for displaying in the UI.
    */
    function isABatchOpen() public view returns(bool, uint256) {
        return (anyBatchOpen, currentOpenBatch);
    }

    function getOpenAuctions() public view returns(uint256[]) {
        return openAuctions;
    }

    function getQueryPrice() public returns(uint256) {
        return oraclize_getPrice("URL");
    }

    /*
    @dev Returns the bid of the '_bidder'
    */
    function bidOfBidder(address _bidder, uint256 _auction) public view returns(uint256) {
        return gopAuctions[_auction].bidFor[_bidder];
    }

    /*
    @dev Returns a two lists, the auctions the user is participating in and
    the auctions the user created.
    */
    function getAuctionsFor(address _user) public view returns(uint256[], uint256[]) {
        return(auctionsCreatedBy[_user], auctionsParticipating[_user]);
    }

    /*  RESTRICTED  */
    function closeAuction(uint256 _auction) public onlyOwner() {
        _removeAuction(_auction);
        gopAuctions[_auction].isOpen = false;
    }

    /*  PRIVATE FUNCS   */

    function _removeAuction(uint256 _id) private {
        uint256 index = auctionIndex[_id];
        uint256 lastAuctionIndex = openAuctions.length.sub(1);
        uint256 lastAuction = openAuctions[lastAuctionIndex];

        openAuctions[index] = lastAuction;
        auctionIndex[lastAuction] = index;

        delete openAuctions[lastAuctionIndex];

        openAuctions.length--;
    }

    function _shouldClose() private view returns(bool) {
        if(currentOpenBatch >= 1 && currentOpenBatch <= 4) return horsesForGen[currentOpenBatch] == 500;
        if(currentOpenBatch == 5) return horsesForGen[5] == 1500;
        if(currentOpenBatch == 6) return horsesForGen[6] == 2500;
        if(currentOpenBatch == 7) return horsesForGen[7] == 3500;
        if(currentOpenBatch == 8) return horsesForGen[8] == 5500;
        if(currentOpenBatch == 9) return horsesForGen[9] == 8500;
        if(currentOpenBatch == 10) return horsesForGen[10] == 9500;
    }

    // Added April 18 2019 to meet proxy requirements.
    address foundationAuctions;

    function setFoundationAddress(address _foundation) public onlyOwner() {
        foundationAuctions = _foundation;
    }
}
